// UserData.js
const usersData = [
    { id: 'user1', password: 'password1', name: 'User 1', age: 25, email: 'user1@example.com' },
    { id: 'user2', password: 'password2', name: 'User 2', age: 30, email: 'user2@example.com' },
    // Add more users if needed
  ];
  
  export default usersData;
